const myList = [{ lol: 'home' }, { lol: 'home' }, { lol: 'home' }, { lol: 'home' }, { lol: 'home' }];

const list = [
	{ name: 'Стікери', value: 'Stiker' },
	{ name: 'Прапори', value: 'Prapor' },
	{ name: 'Плакати', value: 'Baner' },
	{ name: 'Футболки', value: 'footbolka' },
	{ name: 'Худі', value: 'Sweatshirt' },
	{ name: 'Кепки', value: 'baysbolka' },
	{ name: 'Екосумки', value: 'sumka' },
];

console.log(
	myList.map((obj) => {
		<li>{obj.lol}</li>;
	})
);

const Header = () => {
	return (
		<div className={root}>
			<div className="logotyp">
				Web Deweloper <span>Kondratiev</span>
			</div>
			<ul className="myList">
				{list.map((obj, index) => (
					<li className="hhhh" onClick={() => targetState(obj)} key={index}>
						<a>{obj.name}</a>
					</li>
				))}
			</ul>
		</div>
	);
};

export default Header;
